      SELECT DISTINCT col1 AS col1 FROM tab1 AS cor0 WHERE + 79 * col2 NOT BETWEEN col0 / + 72 + - CAST ( NULL AS INTEGER ) / - + col2 AND + + col2;
  - name: tab1

outputs:
  - name: q2350.out
    data: |
      14
      47
      5
